import { items, ItemsNavbar } from "./items";
import "./styles.css";
export const Navbar = () => {
  return (
    <main className="container">
      <ul className="items">
        <li className="subitems">Navbar</li>
        {items.map((value: ItemsNavbar) => (
          <li className="subitems">{value.label}</li>
        ))}
      </ul>
    </main>
  );
};
